import React from 'react';
import './App.css';
import axios from 'axios'



class App extends React.Component {
  constructor(){
    super()
    this.state = {
      currentCompany:""
    }
  }
  componentDidMount(){
    const api = axios.create({
      baseURL: 'http://localhost:9200/company_test/_search?q=company_name:docuprint'
    })
    api.get('')
      .then(async(res) => {
        console.log(res.data.hits.hits[0]._source.company_name)
        this.setState({currentCompany:res.data.hits.hits[0].source.company_name})
    });
  }

  render() {
    return (
      <div>
        <ul>
          {this.state.currentCompany}
        </ul>
      </div>
    )

  }
}

export default App;
